import './App.css';

import ScrollingText from './components/ScrollingText/ScrollingText';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />



        <ScrollingText anDur={1} />

      </header>
    </div>
  );
}

export default App;
